import { Link } from "react-router-dom";
import "./searchItem.css";

const SearchItem = ({ item }) => {
  console.log(item);
  return (
    <div className="searchItem">
      {item.property &&
        item.property.photoUrls &&
        item.property.photoUrls.length > 0 && (
          <img src={item.image_url} alt="" className="siImg" />
        )}
      <div className="siDesc">
        <h1 className="siTitle">
          {item && item.property.name ? item.property.name : "no name"}
        </h1>
        <span className="siDistance">5km from center</span>
        <span className="siTaxiOp">Free airport taxi</span>
        <span className="siSubtitle">{item.accessibilityLabel}</span>
        <span className="siFeatures">{item.property.reviewScoreWord}</span>
        <span className="siCancelOp">Free cancellation </span>
        <span className="siCancelOpSubtitle">
          You can cancel later, so lock in this great price today!
        </span>
      </div>
      <div className="siDetails">
        {item.property.propertyClass && (
          <div className="siRating">
            <span>Excellent</span>
            <button>{item.property.propertyClass}</button>
          </div>
        )}
        <div className="siDetailTexts">
          <span className="siPrice">
            ${item.property.priceBreakdown.grossPrice.value}
          </span>
          <span className="siTaxOp">Includes taxes and fees</span>
          <Link to={`/hotels/find/${item.hotel_id}`}>
            <button className="siCheckButton">See availability</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default SearchItem;
